import React from 'react';
import './product.scss'

const Product = ({ title, imageUrl }) => {
    return (
        <div
            style={{
                backgroundImage: `url(${imageUrl})`
            }}
            className='product-item'
        >
            <div className="content">
                <h1>{title}</h1>
            </div>

        </div>
    );
};

export default Product;
